"""
GOST R 54084-2010: Models of the atmosphere in the boundary layer
at altitudes from 0 to 3000 m for aerospace practice. Parameters.

ГОСТ Р 54084-2010: Модели атмосферы в пограничном слое на высотах
от 0 до 3000 м для аэрокосмической практики. Параметры.

This module contains digitized data from the standard tables.

Data organization:
    Each parameter is a dict: {(lat_N, lon_E): {season: [(val, std), ...]}}
    - lat_N: latitude in degrees North (40-75)
    - lon_E: longitude in degrees East (20-175), negative = West
    - season: "winter", "spring", "summer", "autumn", or "annual"
    - Each season contains 9 tuples, one per height level

Height levels (meters above ground):
    HEIGHTS = [10, 100, 300, 600, 1000, 1500, 2000, 2500, 3000]

Seasons:
    winter  = December, January, February
    spring  = March, April, May
    summer  = June, July, August
    autumn  = September, October, November
    annual  = yearly mean

Parameters and their value tuples:
    temperature:                (T [K],    σT [K])
    pressure:                   (P [hPa],  σP [%])
    density:                    (ρ [kg/m³], σρ [kg/m³])
    scalar_wind_speed:          (Vs [m/s],  σv [m/s])
    zonal_wind_speed:           (Vx [m/s],  σvx [m/s])
    meridional_wind_speed:      (Vy [m/s],  σvy [m/s])
    resultant_wind:             (VR [m/s],  θR [°])
    specific_humidity:          (q [g/kg],  σq [g/kg])
    relative_humidity_dewpoint: (RH [%],    Dp [°C])

Usage example:
    from gost_54084_data import temperature, HEIGHTS

    # Get winter temperature profile at 55°N, 30°E
    profile = temperature[(55, 30)]["winter"]
    for h, (t, sigma_t) in zip(HEIGHTS, profile):
        print(f"  {h:5d} m: T = {t:.1f} K, σT = {sigma_t:.1f} K")
"""

